import axios from "axios";
// "https://newsapi.org/v2/top-headlines?country=ru&apiKey=ed0b5d92959f4ad5ac3f43af3002d252"
const apiKey = "ed0b5d92959f4ad5ac3f43af3002d252";
const host = axios.create({
    baseURL: 'https://newsapi.org/v2/'

});

export const fetchNews = async ()=>{
    const {data} = await host.get('top-headlines?country=ru&apiKey=ed0b5d92959f4ad5ac3f43af3002d252' );
    return data
}
export const fetchingNews = axios.get('https://newsapi.org/v2/top-headlines?', {params:{country:"ru", apiKey:"ed0b5d92959f4ad5ac3f43af3002d252"}}).then((data)=>{
    console.log(data)})
